def lists_with_product_equal_n(lst):
    result = []
    n = len(lst)
    target = 36

    for i in range(n):
        product = 1
        for j in range(i, i+n):
            product *= lst[j % n]
            if product == target:
                result.append(lst[i:j % n+1])

    return result
